import React from 'react';
import { useNavigate } from 'react-router-dom';


const Meetings = () => {
  const navigate = useNavigate();

  const handleCreateMeeting = () => {
    navigate('/meetings/new');
  };

  return (
    <div className="p-6 flex-grow">
      <div className="flex justify-between items-center mb-6">
        <h2 className="text-xl font-bold">Meeting List</h2>
        <button className="bg-purple-600 text-white px-4 py-2 rounded" onClick={handleCreateMeeting}>
          Create Meeting
        </button>
      </div>
      <div className="bg-gray-100 p-10 rounded-lg text-center">
        <div className="mb-4">
          <svg
            className="w-16 h-16 mx-auto"
            fill="none"
            stroke="currentColor"
            viewBox="0 0 24 24"
            xmlns="http://www.w3.org/2000/svg"
          >
            <path
              strokeLinecap="round"
              strokeLinejoin="round"
              strokeWidth="2"
              d="M8 7V3m8 4V3m-4 4v4m-5 4v5h10v-5m5-4H3m6 4h6m-6 0v5m6-5v5"
            />
          </svg>
        </div>
        <h3 className="text-2xl font-semibold mb-4">No Meetings</h3>
        <p className="mb-4">
          This is where all of your organizationâ€™s future meetings will live.
          For additional information and best practices, check out our{' '}
          <a href="#" className="text-blue-500 underline">
            Meetings help page
          </a>
          .
        </p>
        <button className="bg-purple-600 text-white px-4 py-2 rounded" onClick={handleCreateMeeting}>
          Create Meeting
        </button>
      </div>
    </div>
  );
};

export default Meetings;
